    <div className="navBar">
      <Link to="..">
      <button type="button" class="btn btn-primary">Menu</button>
        </Link>
      <Link to="..">Locations</Link>
      <Link to="..">SpecialOffers</Link>
    </div>
  );
}


export default NavBar
